import React from 'react'
import  Nav from './Nav'
 

 function Navbar() {
  return (
    <>
     <Nav title = "CoUrSESaPP" 
     first = "Home" 
     second = "View Courses"
      third  = "Add Courses" 
      fourth = "Update Course"/>
      
    </>
  )
}
export default Navbar;
